import React from "react";
import { NavLink } from "react-router-dom";
import "./css/style.css";

const activeStyle = {
  fontWeight: "bold",
  color: "white",
};

const navItems = [
  { text: "Home", path: "/" },
  { text: "About", path: "/about" },
  { text: "Contact", path: "/contact" },
  {
    text: "Dropdown",
    dropdown: true,
    subItems: [{ text: "Action", path: "/" }, { text: "Another action", path: "/" }, { divider: true }, { text: "Something else here", path: "/" }],
  },
  { text: "Disabled", path: "#", disabled: true },
];

function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <div className="container-fluid">
        <NavLink className="navbar-brand" to="/">
          Navbar
        </NavLink>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            {navItems.map((item) => {
              if (item.dropdown) {
                return (
                  <li key={item.text} className="nav-item dropdown">
                    <NavLink className="nav-link dropdown-toggle" to={item.path} role="button" data-bs-toggle="dropdown" aria-expanded="false">
                      {item.text}
                    </NavLink>
                    <ul className="dropdown-menu">
                      {item.subItems.map((subItem, index) => {
                        if (subItem.divider) {
                          return <hr key={index} className="dropdown-divider" />;
                        }
                        return (
                          <li key={subItem.text}>
                            <NavLink className="dropdown-item" to={subItem.path}>
                              {subItem.text}
                            </NavLink>
                          </li>
                        );
                      })}
                    </ul>
                  </li>
                );
              } else {
                return (
                  <li key={item.text} className="nav-item">
                    <NavLink exact={!item.subItems} to={item.path} activeStyle={activeStyle} className="nav-link" disabled={item.disabled}>
                      {item.text}
                    </NavLink>
                  </li>
                );
              }
            })}
          </ul>
          <form className="d-flex" role="search">
            <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
            <button className="btn btn-outline-success" type="submit">
              Search
            </button>
          </form>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
